function setModifiedDate(i,o){document.getElementById("last-modified")&&fetch("https://api.github.com/repos/"+i).then(e=>e.json()).then(e=>{console.log(e);var t="история изменений";void 0===e||!Array.isArray(e)||(e=e[0].commit.committer.date.slice(0,10))!=o&&(t="обновлено: "+e.split("-").reverse().join(".")),document.getElementById("last-modified").innerHTML="<a target='_blank' href='https://github.com/"+i+"'>"+t+"</a>"})}